import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <Link to="/login">Login</Link>
          </li>
          <li>
            <Link to="/register">Register</Link>
          </li>
          <li>
            <Link to="/reserve">Reserve</Link>
          </li>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <a href="#about">About Us</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
